import React from "react";
import Container from "@mui/material/Container";

export default function Login() {
  return (
    <Container
      maxWidth="sm"
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
      }}
    >
      <button
        style={{
          backgroundColor: "#f0f0f0",
          padding: "10px 20px",
          border: "1px solid #ccc",
          borderRadius: "5px",
          cursor: "pointer",
        }}
      >
        Click me
      </button>
    </Container>
  );
}
